INSERT INTO `feed_posts` (`id`, `user_id`, `content`, `media_url`, `hashtags`, `location`, `likes_count`, `shares_count`, `bookmarks_count`, `status`, `created_at`, `updated_at`, `created_by`, `updated_by`) VALUES
(1, 1, 'Abahinzi n\'aborozi bashinganishije ibyabo bamaze gushumbushwa asaga Miliyari 7Frw\n\nMinisitiri w\'Intebe, Dr Nsengiyumva Justin, yatangaje ko Abahinzi n\'aborozi bashinganishije ibyabo bashumbushijwe asaga Miliyari 7Frw kuva gahunda yo kwishingira ibihingwa n\'amatumgo yatangira mu 2019. Icyo gikaba cyarakumiriye igihombo bahuraga na cyo mbere.', 'https://www.kigalitoday.com/IMG/jpg/444-12.jpg', '[\"#ubuhinzi\",\"#ubworozi\",\"#rwanda\",\"#amakuru\"]', 'Rwanda', 0, 0, 0, 'active', '2025-09-29 13:03:09', '2025-10-05 01:41:07', 1, NULL),
(2, 1, 'U Rwanda rugiye kongera umukamo rufatiye urugero kuri Brazil\n\nMinisitiri w\'Ubuhinzi n\'Ubworozi, Dr Mark Cyubahiro Bagabe, avuga ko u Rwanda rugiye kuvugurura icyororo cy\'inka zitanga umukamo, rushingiye ku buryo bukoreshwa muri Brazil. Icyo kizajya rukube gatatu ingano y\'amata aboneka ku munsi, kugeza ubu angana na litiro Miliyoni eshatu.', 'https://www.kigalitoday.com/IMG/jpg/agri-2.jpg', '[\"#ubworozi\",\"#amata\",\"#rwanda\",\"#iterambere\"]', 'Rwanda', 0, 0, 0, 'active', '2025-09-19 17:00:22', '2025-10-05 10:10:04', 1, NULL),
(3, 1, 'Abakurikirana iby\'ubworozi bakomeje gushaka uko umusaruro w\'amata wakwiyongera muri Afurika\n\nAbarenga 500 baturutse ku migabane itandukanye, bateraniye mu Rwanda guhera ku wa Kane tariki 29 Gicurasi 2025, bashakira hamwe ibisubizo by\'uko umusaruro w\'amata wakwiyongera muri Afurika.', 'https://www.kigalitoday.com/IMG/jpg/ok-107.jpg', '[\"#ubworozi\",\"#amata\",\"#afurika\",\"#rwanda\"]', 'Rwanda', 0, 0, 0, 'active', '2025-09-26 03:24:07', '2025-10-05 01:41:07', 1, NULL),
(4, 1, 'Nyagatare: Aborozi barifuza kwemererwa kwitumiriza intanga\n\nBamwe mu borozi mu Karere ka Nyagatare bavuga ko bifuza koroherezwa kwitumiriza hanze intanga z\'amatumgo, kuko kenshi hari igihe bibagora kuzibona bitewe n\'uko zitumizwa na RAB gusa, bigatuma rimwe na rimwe batazibonera igihe bazishakiye.', 'https://www.kigalitoday.com/IMG/png/inka-3.png', '[\"#ubworozi\",\"#nyagatare\",\"#intanga\",\"#rwanda\"]', 'Nyagatare, Rwanda', 0, 0, 0, 'active', '2025-09-12 17:38:32', '2025-10-05 01:41:07', 1, NULL),
(5, 1, 'Abaganga b\'amatumgo barasabwa kurushaho kwegera aborozi\n\nAbaganga b\'amatumgo barasabwa kurushaho kwegera aborozi kugira ngo babafashe mu kurwanya indwara z\'amatumgo no kuzongera umusaruro wabo.', 'https://www.kigalitoday.com/IMG/jpg/aborozi_b_inka_barifuza_laboratwari_yabafasha_mu_buvuzi_bwayo.jpg', '[\"#ubworozi\",\"#amatungo\",\"#ubuvuzi\",\"#rwanda\"]', 'Rwanda', 0, 0, 0, 'active', '2025-09-23 08:34:20', '2025-10-05 01:41:07', 1, NULL),
(6, 1, 'Bahamya ko bikuye mu bukene babikesha amatumgo magufi\n\nHari abaturage bo mu turere 15 tw\'Intara y\'Amajyepfo, Amajyaruguru n\'Iburengerazuba bavuga ko barwanyije imirire mibi ndetse n\'imibereho muri rusange irahinduka byihuse, babikesheje umushinga wiswe PRISM wa Minisiteri y\'Ubuhinzi n\'Ubworozi(MINAGRI).', 'https://www.kigalitoday.com/IMG/jpg/aborozi_baha_inka_ibibabi_bw_ibirayi_biba_byatewe_umuti_bikagira_ingaruka_ku_musaruro_w_amata.jpg', '[\"#ubworozi\",\"#amatungo\",\"#prism\",\"#rwanda\"]', 'Rwanda', 1, 0, 0, 'active', '2025-10-01 01:33:06', '2025-10-05 05:22:44', 1, NULL),
(7, 1, 'U Rwanda rwahagurukiye kuzamura umusaruro w\'amafi\n\nMuri Kamena 2024, u Rwanda rwari rugeze ku musaruro w\'amafi wa toni 48,133 ku rwego rw\'Igihugu, aho toni 9,000 muri zo arizo ziva mu bworozi bwayo andi akava mu burobyi busanzwe, gusa uwo musaruro ngo uracyari hasi, intego ikaba ari ukuwuzamura.', 'https://www.kigalitoday.com/IMG/jpg/bk_kivu_choice_1_.jpg', '[\"#ubworozi\",\"#amafi\",\"#rwanda\",\"#iterambere\"]', 'Rwanda', 0, 0, 0, 'active', '2025-09-27 03:18:34', '2025-10-05 01:41:07', 1, NULL),
(8, 1, 'Ibibwana by\'ingurube bigiye kujya bihabwa amata y\'ifu\n\nAborozi b\'ingurube mu Rwanda batangaje ko mu gihe cy\'amezi arindwi, bazaba batangije gahunda yo guha ibibwana by\'ingurube amata yo kunywa byakorewe, kugira ngo za nyina zororoke vuba.', 'https://www.kigalitoday.com/IMG/jpg/ingurube_zonka_amata.jpg', '[\"#ubworozi\",\"#ingurube\",\"#amata\",\"#rwanda\"]', 'Rwanda', 1, 0, 1, 'active', '2025-09-30 07:43:14', '2025-10-05 01:41:07', 1, NULL),
(9, 1, 'Gakenke: Barishimira ikoranabuhanga risigaye rikoreshwa mu kubegereza intanga z\'ingurube\n\nAborozi b\'ingurube bo mu Karere ka Gakenke, basanga uburyo bwo kubegereza intanga z\'ingurube hakoreshejwe ikoranabuhanga ry\'utudege duto tutagira Abapilote \'Drone\', hari urwego rufatika bimaze kubagezaho.', 'https://www.kigalitoday.com/IMG/jpg/ubwo_buryo_bwo_kwegereza_aborozi_intanga_z_ingurube_hifashishijwe_ikoranabuhanga_ry_utudege_duto_tutagira_abapilote_drone_rikomeze_kuborohereza_kuzibona_byihuse_kandi_hafi.jpg', '[\"#ubworozi\",\"#ingurube\",\"#ikoranabuhanga\",\"#gakenke\"]', 'Gakenke, Rwanda', 0, 0, 0, 'active', '2025-09-01 14:01:50', '2025-10-05 01:41:07', 1, NULL),
(10, 1, 'Musanze: Batashye uruganda ruzaca akajagari mu gutunganya inyama z\'ingurube\n\nMu Karere ka Musanze huzuye uruganda ruzajya rutunganya inyama z\'ingurube hagamijwe kurushaho kuzongerera agaciro mu buryo bwubahirije ubuziranenge.', 'https://www.kigalitoday.com/IMG/jpg/aborozi_biyemeje_kuva_ku_nka_zidatanga_umukamo_bakagura_iza_kijyambere_zizashyirwa_mu_biraro.jpg', '[\"#ubworozi\",\"#ingurube\",\"#musanze\",\"#rwanda\"]', 'Musanze, Rwanda', 0, 0, 0, 'active', '2025-09-05 10:52:31', '2025-10-05 01:41:07', 1, NULL),
(11, 1, 'Burera: Aborozi barasaba kwegerezwa uruganda rutunganya ibiryo by\'amatumgo\n\nAborozi b\'amatumgo bo mu Karere ka Burera, bavuga ko bakomeje kugorwa no kubona ibiryo by\'amatumgo, kubera ko nta nganda zihagije zihaba zibitunganya.', 'https://www.kigalitoday.com/IMG/jpg/aborozi-7.jpg', '[\"#ubworozi\",\"#burera\",\"#amatungo\",\"#rwanda\"]', 'Burera, Rwanda', 0, 0, 0, 'active', '2025-09-02 19:09:46', '2025-10-05 01:41:07', 1, NULL),
(12, 1, 'Nyagatare: Barifuza ko uruganda Inyange rwabafasha kubona inka z\'umukamo\n\nBamwe mu borozi mu Karere ka Nyagatare barifuza ko uruganda Inyange rutunganya ibikomoka ku mata rwabafasha kubona inka z\'umukamo binyuze mu nguzanyo zahabwa aborozi.', 'https://www.kigalitoday.com/IMG/jpg/inyange1-7.jpg', '[\"#ubworozi\",\"#nyagatare\",\"#inka\",\"#amata\"]', 'Nyagatare, Rwanda', 0, 0, 0, 'active', '2025-09-15 02:16:33', '2025-10-05 01:41:07', 1, NULL),
(13, 1, 'Umusaruro wa Girinka: Kuva muri 2000 kugera muri 2023, inka zikubye inshuro zirenga ebyiri\n\nTariki ya 12 Mata 2006, Inama y\'Abaminisitiri yateraniye muri Village Urugwiro, iyobowe na Perezida wa Repubulika Paul Kagame, yafashe ibyemezo bitandukanye, birimo \'kwemeza gahunda n\'ingamba y\'ibiteganywa mu rwego rwo gufasha abaturage kubona inka muri buri rugo\'.', 'https://www.kigalitoday.com/IMG/jpg/inka-105.jpg', '[\"#ubworozi\",\"#girinka\",\"#inka\",\"#rwanda\"]', 'Rwanda', 1, 0, 1, 'active', '2025-09-30 10:23:07', '2025-11-15 17:00:54', 1, NULL),
(14, 1, 'Nyagatare: Aborozi bahigiye kugura inka zitanga umukamo\n\nAborozi mu Karere ka Nyagatare bavuga ko kuba igiciro cy\'amata kiyongereye kikava ku mafaranga 300 kikagera kuri 400 bagiye kuvugurura ubworozi bwabo bagashaka inka zitanga umukamo.', 'https://www.kigalitoday.com/IMG/jpg/inka-110.jpg', '[\"#ubworozi\",\"#nyagatare\",\"#amata\",\"#inka\"]', 'Nyagatare, Rwanda', 1, 0, 0, 'active', '2025-09-13 22:39:57', '2025-10-05 01:41:07', 1, NULL),
(15, 1, 'Kicukiro: DASSO yoroje abaturage inka enye n\'ihene 20\n\nAbagize urwego rwa DASSO rwunganira Akarere ka Kicukiro mu gucunga umutekano, tariki 31 Gicurasi 2024 boroje abaturage mu Murenge wa Gahanga hagamijwe kubafasha kwikura mu bukene, hakaba hatanzwe inka enye ndetse n\'amatumgo magufi y\'ihene 20.', 'https://www.kigalitoday.com/IMG/jpg/dasso_kicukiro_6_.jpg', '[\"#ubworozi\",\"#kicukiro\",\"#dasso\",\"#rwanda\"]', 'Kicukiro, Rwanda', 1, 0, 0, 'active', '2025-09-24 05:00:48', '2025-10-05 01:41:07', 1, NULL),
(16, 1, 'MINAGRI yatangije ikoranabuhanga rizongera umusaruro w\'amata\n\nMinisiteri y\'Ubuhinzi n\'Ubworozi (MINAGRI) ibinyujije mu kigo kiyishamikiyeho gishinzwe Ubuhinzi n\'Ubworozi (RAB), ku bufatanye n\'Ikigo mpuzamahanga gikora ubushakashatsi ku bworozi (International Livestock Research Institute/ILRI), batangije ikoranabuhanga rizajya riha umworozi w\'Inka amakuru amufasha kongera umukamo.', 'https://www.kigalitoday.com/IMG/jpg/ifi_1-2.jpg', '[\"#ubworozi\",\"#minagri\",\"#rab\",\"#amata\"]', 'Rwanda', 0, 0, 0, 'active', '2025-09-02 21:34:39', '2025-10-05 01:41:07', 1, NULL),
(17, 1, 'Nyagatare: Inka 60 zimaze gukurwa mu bworozi kubera indwara y\'uburenge\n\nUmuyobozi w\'Ikigo cy\'Igihugu gishinzwe guteza imbere Ubuhinzi n\'Ubworozi (RAB) Sitasiyo ya Nyagatare, John Kayumba, avuga ko inka 60 ari zo zimaze gukurwa mu bworozi kubera indwara y\'uburenge yagaragaye mu cyumweru gishize mu rwuri rw\'umworozi wo mu Murenge wa Tabagwe.', 'https://www.kigalitoday.com/IMG/jpg/isazi_ya_tsetse_ikunze_kwibasira_inka_zegereye_ibice_by_ishyamba_rya_pariki.jpg', '[\"#ubworozi\",\"#nyagatare\",\"#inka\",\"#indwara\"]', 'Nyagatare, Rwanda', 0, 0, 0, 'active', '2025-09-18 04:12:03', '2025-10-05 01:41:07', 1, NULL),
(18, 1, 'Hagaragajwe uburyo imimero y\'ibigori mu cyumweru kimwe itanga ibiryo by\'amatumgo bitubutse\n\nUko ibihe bigenda bitambuka, abantu bava mu buhinzi n\'ubworozi gakondo bagana mu kubigira umwuga, ni nako ubushakashatsi bugenda butanga ibisubizo. Ni muri urwo rwego hagaragajwe ko guhinga ibigori ahatari mu butaka mu gihe kitarenze icyumweru, bitanga ibiryo by\'amatumgo bitubutse kandi bikungahaye ku bitera imbaraga.', 'https://www.kigalitoday.com/IMG/jpg/imimero_y_ibigori_yagaragajwe_na_duhamic_adri_mu_imurikabikorwa_ry_abafatanyabikorwa_bo_mu_karere_ka_gisagara_ngo_iba_ikungahaye_ku_byubaka_umubiri_n_ibitera_imbaraga.jpg', '[\"#ubuhinzi\",\"#ibigori\",\"#amatungo\",\"#rwanda\"]', 'Rwanda', 0, 0, 0, 'active', '2025-09-21 09:06:50', '2025-10-05 01:41:07', 1, NULL),
(19, 1, 'Aborozi b\'amatumgo barasabwa kurushaho kwegera aborozi\n\nAborozi b\'amatumgo barasabwa kurushaho kwegera aborozi kugira ngo babafashe mu kurwanya indwara z\'amatumgo no kuzongera umusaruro wabo.', 'https://www.kigalitoday.com/IMG/jpg/n_abafite_inka_nkeya_ziracyarisha_mu_nzuri_bisanzwe.jpg', '[\"#ubworozi\",\"#amatungo\",\"#ubuvuzi\",\"#rwanda\"]', 'Rwanda', 0, 0, 1, 'active', '2025-09-29 03:15:19', '2025-10-06 16:55:12', 1, NULL),
